import React from "react";
import "../Stylesheets/Hero.scss";

const Hero = () => {
  return (
    <div className='hero'>
      <div className='hero-header'>
        <h1 className='hero-header-name'>Team LOSD</h1>
        <h3 className='hero-header-info'>Lords of Squadron Defence</h3>
      </div>
    </div>
  );
};

export default Hero;
